def find_all_paths(graph, start, end, path=[]):
        path = path + [start]
        if start == end:
            return [path]
        if start not in frozenset(graph):
            print ("dead end : ", path)
            return []
        paths = []
        for node in graph[start]:
            if node not in path:
                print ("path  = " , path)
                newpaths = find_all_paths(graph, node, end, path)
                for newpath in newpaths:
                    print ("done ", newpath)
                    paths.append(newpath)
        return paths
    
